import styles from "./Topbar.module.css";
const Topbar = () => {
  return (
    <div className={styles.top}>
      <div className={styles.topLeft}></div>
      <div className={styles.topCenter}></div>
      <div className={styles.topRight}></div>
    </div>
  );
};

export default Topbar;
